import React, { Component, Fragment} from 'react';


class MobileToggle extends Component {
    constructor(props){
      super(props);
      this.state={
        isChecked: props.isChecked || false
      };
      this.handleChange = this.handleChange.bind(this);
    }
    handleChange() {
        //this.setState({ isChecked: !this.state.isChecked })
        alert('Change, Hello');
      }
    render(){
        return(
            <Fragment>
                <div className="onoffswitch">
                    <input type="checkbox" value={this.state.isChecked} id="mobileonOffSwitch" onChange={this.handleChange} name="onoffswitch" className="onoffswitch-checkbox" checked />
                    <label className="onoffswitch-label" for="mobileonOffSwitch">
                            Mobile Image Preview
                        <span className="onoffswitch-inner"></span>
                        <span className="onoffswitch-switch"></span>
                    </label>
                </div>
            </Fragment>
        );
    }
}

export default MobileToggle;
